const FormLogin = () => (
    <form class="col-12">
        <div className="form-group">
            <input type="text" className="form-control" placeholder="Correo de Usuario"/>
        </div>
        <div className="form-group">
            <input type="password" className="form-control" placeholder="Correo de Usuario"/>
        </div>
        <button type="button" class="btn btn-primary">Primary</button>
    </form>
);

export default FormLogin;
